import axios from "axios";

export  function fetchUserDetails (accountNumber){
    axios.get(`http://localhost:8080/details?accountNumber=${accountNumber}`)
        .then(function (response) {
            console.log(response);
            return response;

        })
        .catch(function (error) {
            console.log(error);
            return error;
        });
 }
